		california_scorpionfish_description = "–°–∫–æ—Ä–ø–µ–Ω–∞ –≥—É—Ç–∞—Ç–∞ –µ –≤–∏–¥ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ —Å–∫–æ—Ä–ø–∏–æ–Ω–Ω–∏ —Ä–∏–±–∏, –∏–∑–≤–µ—Å—Ç–µ–Ω —Å –æ–±—â–æ—Ç–æ –∏–º–µ –∫–∞–ª–∏—Ñ–æ—Ä–Ω–∏–π—Å–∫–∞ —Å–∫–æ—Ä–ø–µ–Ω–∞. –¢—è –µ –µ–Ω–¥–µ–º–∏—á–Ω–∞ –∑–∞ –∏–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω, –∫—ä–¥–µ—Ç–æ —Å–µ —Å—Ä–µ—â–∞ –ø–æ –∫—Ä–∞–π–±—Ä–µ–∂–∏–µ—Ç–æ –Ω–∞ –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è –∏ –ë–∞—Ö–∞ –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è.",
		canary_rockfish_variant_1_description = "–ö–∞–Ω–∞—Ä—Å–∫–∞ —Å–∫–∞–ª–Ω–∞ —Ä–∏–±–∞, –∏–∑–≤–µ—Å—Ç–Ω–∞ —Å—ä—â–æ –∫–∞—Ç–æ –æ—Ä–∞–Ω–∂–µ–≤–∞ —Å–∫–∞–ª–Ω–∞ —Ä–∏–±–∞, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ —Å–∫–æ—Ä–ø–∏–æ–Ω–Ω–∏ —Ä–∏–±–∏ (Scorpaenidae), –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ Sebastinae. –¢—è –µ –µ–Ω–¥–µ–º–∏—á–Ω–∞ –∑–∞ –≤–æ–¥–∏—Ç–µ –Ω–∞ –¢–∏—Ö–∏—è –æ–∫–µ–∞–Ω –æ—Ç –∑–∞–ø–∞–¥–Ω–∞ –°–µ–≤–µ—Ä–Ω–∞ –ê–º–µ—Ä–∏–∫–∞.",
		canary_rockfish_variant_2_description = "–ö–∞–Ω–∞—Ä—Å–∫–∞—Ç–∞ —Ä–∏–±–∞-—Å–∫–∞–ª–∏—Å—Ç–∫–∞, –∏–∑–≤–µ—Å—Ç–Ω–∞ –æ—â–µ –∫–∞—Ç–æ –æ—Ä–∞–Ω–∂–µ–≤–∞—Ç–∞ —Ä–∏–±–∞-—Å–∫–∞–ª–∏—Å—Ç–∫–∞, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ —Å –ª—ä—á–µ—Å—Ç–∏ –ø–µ—Ä–∫–∏, –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∞ –∫—ä–º –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∏, —Å–∫–∞–ª–∏—Å—Ç–∏—Ç–µ —Ä–∏–±–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ä–ø–∞–µ–Ω–∏–¥–∏. –¢—è –µ –µ—Å—Ç–µ—Å—Ç–≤–µ–Ω–æ —Å—Ä–µ—â–∞–Ω–∞ –≤—ä–≤ –≤–æ–¥–∏—Ç–µ –Ω–∞ –¢–∏—Ö–∏—è –æ–∫–µ–∞–Ω –æ—Ç –∑–∞–ø–∞–¥–Ω–æ—Ç–æ –∏–∑—Ç–æ—á–Ω–æ—Ç–æ –∫—Ä–∞–π–±—Ä–µ–∂–∏–µ –Ω–∞ –°–µ–≤–µ—Ä–Ω–∞ –ê–º–µ—Ä–∏–∫–∞.",
		chilipepper_rockfish_description = "–°–µ–±–∞—Å—Ç–µ—Å –≥—É–¥–∏, –æ—â–µ –∏–∑–≤–µ—Å—Ç–Ω–∞ –∫–∞—Ç–æ —á–∏–ª–∏ —Ä–∏–±–∞-—Å–∫–∞–ª–∏—Å—Ç–∫–∞ –∏ —á–∏–ª–∏–ø–µ–ø—ä—Ä, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ —Å –ª—ä—á–µ—Å—Ç–∏ –ø–µ—Ä–∫–∏, –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∞ –∫—ä–º –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∏, —Å–∫–∞–ª–∏—Å—Ç–∏—Ç–µ —Ä–∏–±–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ä–ø–∞–µ–Ω–∏–¥–∏. –¢–æ–∑–∏ –≤–∏–¥ –≥–ª–∞–≤–Ω–æ –∂–∏–≤–µ–µ –∫—Ä–∞–π –±—Ä–µ–≥–∞ –Ω–∞ –∑–∞–ø–∞–¥–Ω–æ—Ç–æ –∏–∑—Ç–æ—á–Ω–æ—Ç–æ –∫—Ä–∞–π–±—Ä–µ–∂–∏–µ –Ω–∞ –°–µ–≤–µ—Ä–Ω–∞ –ê–º–µ—Ä–∏–∫–∞ –æ—Ç –ë–∞—Ö–∞ –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è –¥–æ –í–∞–Ω–∫—É–≤—ä—Ä.",
		china_rockfish_description = "–ö–∏—Ç–∞–π—Å–∫–∏—è—Ç –º–æ—Ä—Å–∫–∏ —Å–∫–æ—Ä–ø–∏–æ–Ω, –∂—ä–ª—Ç–∏—è—Å–∫ —Å–≤–µ—Ç–ª–æ–∫—Ä–∞–∫ –∏–ª–∏ –∂—ä–ª—Ç–∏ –ø–µ—Ç–Ω–∞ –∫–æ—Ä–∏—Ñ–µ–Ω–∞ –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞, –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∞ –∫—ä–º –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∞–µ, –º–æ—Ä—Å–∫–∏—Ç–µ —Å–∫–æ—Ä–ø–∏–æ–Ω–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ä–ø–∏–µ–Ω–∏–¥–∏. –¢–æ–π –µ –µ–Ω–¥–µ–º–∏—á–µ–Ω –∑–∞ –≤–æ–¥–∏—Ç–µ –Ω–∞ –¢–∏—Ö–∏—è –æ–∫–µ–∞–Ω –∫—Ä–∞–π –∑–∞–ø–∞–¥–Ω–æ—Ç–æ –°–µ–≤–µ—Ä–Ω–∞ –ê–º–µ—Ä–∏–∫–∞.",
