		cowcod_description = "Sebastes levis, –∫—Ä–∞–≤–∞ –ø—ä—Å—Ç—ä—Ä–≤–∞ –∏–ª–∏ –∫—Ä–∞–≤–∞ –ø—ä—Å—Ç—ä—Ä–≤–∞, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞, –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∞ –∫—ä–º –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ Sebastinae, —Å–∫–∞–ª–∏—Å—Ç–∏—Ç–µ —Ä–∏–±–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ Scorpaenidae. –¢—è —Å–µ –Ω–∞–º–∏—Ä–∞ –≤ –∏–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∏ –æ–∫–µ–∞–Ω.<br><br>–†–∞–∑–Ω–æ–æ–±—Ä–∞–∑–∏–µ—Ç–æ –≤ —Ä–∞–∑–º–µ—Ä–∏—Ç–µ –∏–º —Å—ä–∑–¥–∞–≤–∞ –∫–æ–Ω–∫—É—Ä–µ–Ω—Ç–Ω–∞ –∫–æ–Ω–∫—É—Ä–µ–Ω—Ç–æ—Å–ø–æ—Å–æ–±–Ω–æ—Å—Ç.",
