		deacon_rockfish_description = "Sebastes diaconus, –∏–∑–≤–µ—Å—Ç–Ω–∞ –æ—â–µ –∫–∞—Ç–æ –ø—É—Ö–∫–∞–≤–æ–ø–µ—Ä–∫–∞ –¥—è–∫–æ–Ω, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞, –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∞ –∫—ä–º –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ Sebastinae, –ø—É—Ö–∫–∞–≤–æ–ø–µ—Ä–∫–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ Scorpaenidae. –¢—è —Å–µ —Å—Ä–µ—â–∞ –≤ –∏–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω.<br><br>–ú—ä–∂–∫–∏—Ç–µ –≤–∏–Ω–∞–≥–∏ —â–µ –∂–∏–≤–µ—è—Ç –ø–æ-–¥—ä–ª–≥–æ –æ—Ç –∂–µ–Ω—Å–∫–∏—Ç–µ.",
		dusky_rockfish_dark_version_description = "Sebastes ciliatus –µ –≤–∏–¥ –ø—É—Ö–∫–∞–≤–æ–ø–µ—Ä–∫–∞, –∏–∑–≤–µ—Å—Ç–Ω–∞ —Å—ä—â–æ –∫–∞—Ç–æ —Ç—ä–º–Ω–æ–∫–∞—Ñ—è–≤–∞ –ø—É—Ö–∫–∞–≤–æ–ø–µ—Ä–∫–∞. –û–±–∏–∫–Ω–æ–≤–µ–Ω–æ —Å–µ —Å—Ä–µ—â–∞ –≤ –°–µ–≤–µ—Ä–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω.",
