		flag_rockfish_description = "Sebastes rubrivinctus, –∏–∑–≤–µ—Å—Ç–µ–Ω —Å—ä—â–æ –∫–∞—Ç–æ —Ñ–ª–∞–≥–æ–≤ —Ä–æ–∫—Ñ–∏—à, –∏—Å–ø–∞–Ω—Å–∫–∏ —Ñ–ª–∞–≥, —á–µ—Ä–≤–µ–Ω–∞ –∏–≤–∏—Ü–∞ –∏–ª–∏ –±–µ—Ä–±–µ—Ä–ø–æ–ª, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∞–µ, —Ç.–µ. —Ä–æ–∫—Ñ–∏—à–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ñ–µ–Ω–∏–¥–∏. –°—Ä–µ—â–∞ —Å–µ –≤ –ò–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –û–∫–µ–∞–Ω.",
		gopher_rockfish_description = "–ì–æ—Ñ—ä—Ä —Ä–æ–∫—Ñ–∏—à, –∏–∑–≤–µ—Å—Ç–µ–Ω –æ—â–µ –∫–∞—Ç–æ ‚Äû–≥–æ—Ñ—ä—Ä –º–æ—Ä—Å–∫–∏ –ø—Ä–∞—Å–µ—Ü‚Äú, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∞–µ, —Ç.–µ. —Ä–æ–∫—Ñ–∏—à–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ñ–µ–Ω–∏–¥–∏. –°—Ä–µ—â–∞ —Å–µ –≤ –ò–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –û–∫–µ–∞–Ω, –æ—Å–Ω–æ–≤–Ω–æ –∫—Ä–∞–π –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è.",
		grass_rockfish_dark_version_description = "–ì—ä—Å–∫–∞ —Ä–∏–±–∞ –Ω–∞ –∫–∞–º—ä–∫ —Ç—ä–º–Ω–∞ –≤–µ—Ä—Å–∏—è –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ Scorpaenidae, –Ω–∞—Ä–∏—á–∞–Ω–∞ –æ—â–µ Sebastes rastrelliger. –¢–æ–∑–∏ –≤–∏–¥ –µ –æ—Å–Ω–æ–≤–Ω–æ —Ä–∞–∑–ø—Ä–æ—Å—Ç—Ä–∞–Ω–µ–Ω –≤—ä–≤ –≤–æ–¥–∏—Ç–µ –Ω–∞ –∏–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω.<br><br>–ù–∞–π-—á–µ—Å—Ç–æ —Å–µ –ª–æ–≤–∏ –æ—Ç —Ä–∏–±–æ–ª–æ–≤—Ü–∏ –∑–∞ —Å–≤–æ–±–æ–¥–Ω–æ –≤—Ä–µ–º–µ —Å –ø–æ–º–æ—â—Ç–∞ –Ω–∞ –≤—ä–¥–∏—Ü–∞ –∏ –≤–ª–∞–∫–Ω–æ.",
		grass_rockfish_light_version_description = "–ì—ä—Å–∫–∞ —Ä–∏–±–∞ –Ω–∞ –∫–∞–º—ä–∫ —Å–≤–µ—Ç–ª–∞ –≤–µ—Ä—Å–∏—è –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ Scorpaenidae, –Ω–∞—Ä–∏—á–∞–Ω–∞ –æ—â–µ Sebastes rastrelliger. –¢–æ–∑–∏ –≤–∏–¥ –µ –æ—Å–Ω–æ–≤–Ω–æ —Ä–∞–∑–ø—Ä–æ—Å—Ç—Ä–∞–Ω–µ–Ω –≤—ä–≤ –≤–æ–¥–∏—Ç–µ –Ω–∞ –∏–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω.<br><br>–ù–∞–π-—á–µ—Å—Ç–æ —Å–µ –ª–æ–≤–∏ –æ—Ç —Ä–∏–±–æ–ª–æ–≤—Ü–∏ –∑–∞ —Å–≤–æ–±–æ–¥–Ω–æ –≤—Ä–µ–º–µ —Å –ø–æ–º–æ—â—Ç–∞ –Ω–∞ –≤—ä–¥–∏—Ü–∞ –∏ –≤–ª–∞–∫–Ω–æ.",
		greenblotched_rockfish_description = "–ó–µ–ª–µ–Ω–∏—Ç–µ –ø–µ—Ç–Ω–∏—Å—Ç–∏ —Å–∫–∞–ª–∏—Å—Ç–∏ —Ä–∏–±–∏ —Å–∞ –¥–æ–ª–Ω–∏ –≤–∏–¥–æ–≤–µ, –∫–æ–∏—Ç–æ —Å–µ –Ω–∞–º–∏—Ä–∞—Ç –∫–∞—Ç–æ –æ—Ç–¥–µ–ª–Ω–∏ –æ—Å–æ–±–∏ –∏–ª–∏ –≤ –º–∞–ª–∫–∏ –≥—Ä—É–ø–∏ –≤ —Å–∫–∞–ª–Ω–∏ —Å—Ç—Ä—É–∫—Ç—É—Ä–∏ –Ω–∞ –¥—ä–ª–±–æ—á–∏–Ω–∏ –º–µ–∂–¥—É 55 –º (180 —Ñ—É—Ç–∞) –∏ 490 –º (1,610 —Ñ—É—Ç–∞). –¢–µ –¥–æ—Å—Ç–∏–≥–∞—Ç –º–∞–∫—Å–∏–º–∞–ª–Ω–∞ –¥—ä–ª–∂–∏–Ω–∞ –æ—Ç 54 —Å–º (21 –∏–Ω—á–∞), –∫–∞—Ç–æ –∂–µ–Ω—Å–∫–∏—Ç–µ —Å–∞ –ø–æ-–≥–æ–ª–µ–º–∏ –æ—Ç –º—ä–∂–∫–∏—Ç–µ. <br><br>–ó–µ–ª–µ–Ω–∏—Ç–µ –ø–µ—Ç–Ω–∏—Å—Ç–∏, –ó–µ–ª–µ–Ω–∏ –ø–µ—Ç–Ω–∏ –∏ –ó–µ–ª–µ–Ω–∏—Ç–µ –∏–≤–∏—Ü–∏ —Å–ø–æ–¥–µ–ª—è—Ç —Å—ä—â–∏—Ç–µ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∏ –∏ –ø–æ–≤–µ–¥–µ–Ω–∏–µ.",
		greenspotted_rockfish_description = "–ó–µ–ª–µ–Ω–∞—Ç–∞ –ø–µ—Ç–Ω–∏—Å—Ç–∞ —Å–∫–∞–ª–∏—Å—Ç–∞ —Ä–∏–±–∞ (Sebastes chlorostictus) –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∏ —Ä–∏–±–∏, –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â –∫—ä–º –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ Sebastinae - —Å–∫–∞–ª–Ω–æ —Ä–∏–±–∏, —á–∞—Å—Ç –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ Scorpaenidae. –ù–∞–º–∏—Ä–∞ —Å–µ –≤ –ò–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω. <br><br>–ó–µ–ª–µ–Ω–∏—Ç–µ –ø–µ—Ç–Ω–∏—Å—Ç–∏, –ó–µ–ª–µ–Ω–∏—Ç–µ –ø–µ—Ç–Ω–∏ –∏ –ó–µ–ª–µ–Ω–∏—Ç–µ –∏–≤–∏—Ü–∏ —Å–ø–æ–¥–µ–ª—è—Ç —Å—ä—â–∏—Ç–µ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∏ –∏ –ø–æ–≤–µ–¥–µ–Ω–∏–µ.",
		greenstriped_rockfish_description = "–°–µ–±–∞—Å—Ç–µ—Å –µ–ª–æ–Ω–≥–∞—Ç—É—Å, –∑–µ–ª–µ–Ω–æ–ª–µ–Ω—Ç–æ–≤ —Ä–æ–∫—Ñ–∏—à, –∏–≤–∏—Ü–µ—Å—Ç —Ä–æ–∫—Ñ–∏—à, –∫–ª—É–±–Ω–æ–ª–µ–Ω—Ç–æ–≤ —Ä–æ–∫—Ñ–∏—à, —Ü–∞—Ä—Å–∫–∏ –ø–ª–∞—Ç–µ–Ω–∏, —Ä–µ–π–Ω–∞ –∏–ª–∏ —Å–µ—Ä–µ–Ω–∞, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ä–ø–µ–µ–Ω–æ–≤–∏, –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∏, –æ—Ç —Ä–æ–¥ –°–µ–±–∞—Å—Ç–µ—Å. –ù–∞–º–∏—Ä–∞ —Å–µ –≤ —Å–µ–≤–µ—Ä–æ–∏–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω. <br> <br> –ó–µ–ª–µ–Ω–æ—Ç–æ –ø–µ—Ç–Ω–æ, —Å–ø–æ—Ç–∏—Ä–∞–Ω–æ—Ç–æ –ø–µ—Ç–Ω–æ –∏ –∑–µ–ª–µ–Ω–æ–ª–µ–Ω—Ç–æ–≤–æ—Ç–æ –ø–µ—Ç–Ω–æ —Å–ø–æ–¥–µ–ª—è—Ç –µ–¥–Ω–∏ –∏ —Å—ä—â–∏ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∏ –∏ –ø–æ–≤–µ–¥–µ–Ω–∏–µ.",
		halfbanded_rockfish_description = "–°–µ–±–∞—Å—Ç–µ—Å —Å–µ–º–∏—á–∏–Ω–∫—Ç—É—Å, –ø–æ–ª—É–æ–ø–∞—à–∞—Ç —Ä–æ–∫—Ñ–∏—à, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –°–∫–æ—Ä–ø–µ–µ–Ω–æ–≤–∏, –ø–æ–¥—Å–µ–º–µ–π—Å—Ç–≤–æ –°–µ–±–∞—Å—Ç–∏–Ω–∏, –æ—Ç —Ä–æ–¥ –°–µ–±–∞—Å—Ç–µ—Å. –ù–∞–º–∏—Ä–∞ —Å–µ –≤ –ò–∑—Ç–æ—á–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω.",
		honeycomb_rockfish_description = "–ú–µ–¥–µ–Ω–∞ –ø—á–µ–ª–Ω–∞ —Å–∫–∞—Ä–∏–¥–∞ –∏–º–∞ –∫–æ–º–ø–∞–∫—Ç–Ω–æ –∫–æ—Ä–ø—É—Å—á–µ —Å —à–∏—Ä–∏–Ω–∞, –∫–æ—è—Ç–æ –µ 35% –¥–æ 39% –æ—Ç —Å—Ç–∞–Ω–¥–∞—Ä—Ç–Ω–∞—Ç–∞ –¥—ä–ª–∂–∏–Ω–∞. –¢–µ —Å–∞ –ø–æ–∫—Ä–∏—Ç–∏ —Å —à–∏–ø–æ–≤–µ. –ò–º–∞—Ç –∫–∞—Ñ–µ–≤–∞, –∫–∞—Ñ—è–≤–∞ –∏–ª–∏ —á–µ—Ä–≤–µ–Ω–æ-–∫–∞—Ñ—è–≤–∞ –æ–∫—Ä–∞—Å–∫–∞ —Å 4 –¥–æ 6 –±–µ–ª–∏ –ø–µ—Ç–Ω–∞ –ø—Ä–æ–∏–∑–≤–æ–ª–Ω–æ —Ä–∞–∑–ø–æ–ª–æ–∂–µ–Ω–∏ –Ω–∞–¥ —Å—Ç—Ä–∞–Ω–∏—á–Ω–∞—Ç–∞ –∏–º –ª–∏–Ω–∏—è.",
		kelp_greenling_female_description = "–ï–¥–Ω–∞ –∂–µ–Ω—Å–∫–∞ –∫–µ–ª–ø–æ–≤–æ –∑—ä–ª—Ç–æ–ª–∏–∫–æ –µ –ø—ä—Å—Ç—Ä–∞ –Ω–∞ —Ü—è–ª–æ—Ç–æ —Ç—è–ª–æ —Å –º–∞–ª–∫–∏ —á–µ—Ä–≤–µ–Ω–∏–∫–∞–≤–æ-–∫–∞—Ñ—è–≤–∏ –¥–æ –∑–ª–∞—Ç–∏—Å—Ç–∏ –ø–µ—Ç–Ω–∞ –Ω–∞ —Å–∏–≤–∞ –¥–æ –∫–∞—Ñ—è–≤–∞ –æ—Å–Ω–æ–≤–∞. –ü–ª–∞–≤–Ω–∏—Ü–∏—Ç–µ —Å–∞ –≥–ª–∞–≤–Ω–æ –Ω–∞ –∂—ä–ª—Ç–æ-–æ—Ä–∞–Ω–∂–µ–≤–æ. –ú—ä–∂–∫–∏—Ç–µ –æ–±–∏–∫–Ω–æ–≤–µ–Ω–æ —Å–∞ –æ–ª–∏–≤–∫–æ–≤–æ—Å–∏–≤–∏ –¥–æ –∫–∞—Ñ—è–≤–∏, —Å –Ω–µ—Ä–∞–≤–Ω–æ–º–µ—Ä–Ω–∏ —Å–∏–Ω–∏ –ø–µ—Ç–Ω–∞ –ø–æ –ø—Ä–µ–¥–Ω–∞—Ç–∞ –ø–æ–ª–æ–≤–∏–Ω–∞ –¥–æ –¥–≤–µ —Ç—Ä–µ—Ç–∏ –æ—Ç —Ç–µ–ª–∞—Ç–∞ –∏–º.<br><br>–ù–∞–π-—á–µ—Å—Ç–æ —Å–µ —Å—Ä–µ—â–∞—Ç –≤—ä–≤ –≤–æ–¥–∏, –ø–æ-–º–∞–ª–∫–æ –¥—ä–ª–±–æ–∫–∏ –æ—Ç 328 —Ñ—É—Ç–∞.",
		kelp_greenling_male_description = "–ú—ä–∂–∫–∞—Ç–∞ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –∫–µ–ª–ø –≥—Ä–∏–π–Ω–ª–∏–Ω–≥ –µ –∫–∞—Ñ—è–≤–æ-–æ–ª–∏–≤–∫–æ–≤–∞ –¥–æ —Å–∏–≤–∞, —Å –Ω–µ—Ä–∞–≤–Ω–æ–º–µ—Ä–Ω–æ —Ä–∞–∑–ø–æ–ª–æ–∂–µ–Ω–∏ —Å–∏–Ω–∏ –ø–µ—Ç–Ω–∞, –æ–±—Ä–∞–º–µ–Ω–∏ –æ—Ç —á–µ—Ä–Ω–æ –ø–æ –≥—ä—Ä–±–∞ –∏ –≥–ª–∞–≤–∞—Ç–∞ –π. –ò –¥–≤–∞—Ç–∞ –ø–æ–ª–∞ –∏–º–∞—Ç –∫—ä—Å–∏—á–∫–∏ (—Ü–∏—Ä–∏) –Ω–∞–¥ –≤—Å—è–∫–æ –æ–∫–æ. –¢–∞–∑–∏ –≤–∏–¥ –¥–æ—Å—Ç–∏–≥–∞ –¥–æ 60 —Å–º –¥—ä–ª–∂–∏–Ω–∞.<br><br>–ù–∞–π-—á–µ—Å—Ç–æ —Å–µ —Å—Ä–µ—â–∞ –≤—ä–≤ –≤–æ–¥–∏ —Å –¥—ä–ª–±–æ—á–∏–Ω–∞ –¥–æ 100 –º–µ—Ç—Ä–∞.",
		kelp_rockfish_description = "Sebastes atrovirens, –∫–µ–ª–ø —à–µ–π—Ç–∞–Ω–æ–≤ —Ä–∏–±–∞, –µ –≤–∏–¥ –º–æ—Ä—Å–∫–∞ —Ä–∏–±–∞ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ –∫–∞–º–±–∞–Ω–∫–æ–≤–∏. –¢—è –µ –µ—Å—Ç–µ—Å—Ç–≤–µ–Ω–æ —Ä–∞–∑–ø—Ä–æ—Å—Ç—Ä–∞–Ω–µ–Ω–∞ –≤ –¢–∏—Ö–∏—è –æ–∫–µ–∞–Ω –≤—ä–¥ –∞–º–µ—Ä–∏–∫–∞–Ω—Å–∫–æ—Ç–æ –∫—Ä–∞–π–±—Ä–µ–∂–∏–µ –Ω–∞ –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è –∏ –ú–µ–∫—Å–∏–∫–æ.",
		lingcod_description = "–õ–∏–Ω–≥—É –∫–∞—Ç–æ —Ö–∏—â–Ω–∏—Ü–∏ –º–æ–≥–∞—Ç –¥–∞ –¥–æ—Å—Ç–∏–≥–Ω–∞—Ç —Ç–µ–≥–ª–æ –Ω–∞–¥ 80 –ø–∞—É–Ω–¥–∞ (35 –∫–≥) –∏ –¥—ä–ª–∂–∏–Ω–∞ –æ—Ç 60 –∏–Ω—á–∞ (150 —Å–º). –¢–µ —Å–µ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏–∑–∏—Ä–∞—Ç —Å –≥–æ–ª—è–º–æ —É—Å—Ç–∞ —Å 18 –æ—Å—Ç—Ä–∏ –∑—ä–±–∏. –¶–≤–µ—Ç—ä—Ç –∏–º –µ –ø—Ä–æ–º–µ–Ω–ª–∏–≤, –æ–±–∏–∫–Ω–æ–≤–µ–Ω–æ —Å —Ç—ä–º–Ω–æ –∫–∞—Ñ—è–≤–∏ –∏–ª–∏ –º–µ–¥–Ω–æ-–∫–µ—Å—Ç–µ–Ω—è–≤–∏ –ø–µ—Ç–Ω–∞, –ø–æ–¥—Ä–µ–¥–µ–Ω–∏ –≤ –∫—É–ø—á–∏–Ω–∏.",
		olive_rockfish_description = "–ú–∞—Å–ª–∏–Ω–æ–≤–∏—è—Ç —Å–∫–∞–ª–µ–Ω –æ–∫—É–Ω, Acanthoclinus fuscus, –µ —Å –¥—ä–ª–≥–∏ –ø–µ—Ä–∫–∏ –æ—Ç —Å–µ–º–µ–π—Å—Ç–≤–æ Plesiopidae. –ù–∞–º–∏—Ä–∞ —Å–µ —Å–∞–º–æ –≤ –∏–Ω—Ç–µ—Ä—Ä–∞–º–ø–µ—Ä–Ω–∞—Ç–∞ –∑–æ–Ω–∞ –Ω–∞ –ù–æ–≤–∞ –ó–µ–ª–∞–Ω–¥–∏—è –∏ –≤ —Å–∫–∞–ª–Ω–∏ –±–∞—Å–µ–π–Ω–∏ –ø—Ä–∏ –æ—Ç–ª–∏–≤. –†–∏–±–∞—Ç–∞ –¥–æ—Å—Ç–∏–≥–∞ –¥—ä–ª–∂–∏–Ω–∞ –¥–æ 30 —Å–º.",
		pacific_ocean_perch_description = "–¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∏—è—Ç –ø–µ—Ä–≥–∞–º–µ–Ω—Ç–µ–Ω –æ–∫—É–Ω, –∏–∑–≤–µ—Å—Ç–µ–Ω —Å—ä—â–æ –∫–∞—Ç–æ –¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∏—è –±—è–ª–æ–∫–æ—Ç –∏–ª–∏ –¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∏—è—Ç —à–∫–∞–º–±–∞—Ä, –µ —Ä–∏–±–∞, –∫–æ—è—Ç–æ —Å–µ —Å—Ä–µ—â–∞ –≤ –°–µ–≤–µ—Ä–Ω–∏—è –¢–∏—Ö–∏ –æ–∫–µ–∞–Ω: –æ—Ç —é–∂–Ω–∞ –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è –æ–∫–æ–ª–æ –¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∏—è –ø—Ä–µ–ª–æ–º –¥–æ —Å–µ–≤–µ—Ä–µ–Ω –•–æ–Ω—à—É, –Ø–ø–æ–Ω–∏—è, –≤–∫–ª—é—á–∏—Ç–µ–ª–Ω–æ –ë–µ—Ä–∏–Ω–≥–æ–≤–æ –º–æ—Ä–µ.",
		pacific_sand_sole_description = "–¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∞—Ç–∞ –ø—è—Å—ä—á–Ω–∞ —Å–æ–º–∞, –∏–∑–≤–µ—Å—Ç–Ω–∞ –ø—Ä–æ—Å—Ç–æ –∫–∞—Ç–æ –ø—è—Å—ä—á–Ω–∞ —Å–æ–º–∞, –µ –≤–∏–¥ –ø–ª–æ—Å–∫–∞ —Ä–∏–±–∞, –∫–æ—è—Ç–æ –æ–±–∏—Ç–∞–≤–∞ —Å–µ–≤–µ—Ä–æ–∏–∑—Ç–æ—á–Ω–∏—Ç–µ –≤–æ–¥–∏ –Ω–∞ –¢–∏—Ö–∏—è –æ–∫–µ–∞–Ω, –∫—ä–¥–µ—Ç–æ –∂–∏–≤–µ–µ –Ω–∞ –ø—è—Å—ä—á–Ω–æ –¥—ä–Ω–æ. –ï–¥–∏–Ω—Å—Ç–≤–µ–Ω–∏—è—Ç –≤–∏–¥ –≤ —Ä–æ–¥–∞ Psettichthys, —Ç–æ–π —Å–µ —Å—Ä–µ—â–∞ –æ—Ç –ë–µ—Ä–∏–Ω–≥–æ–≤–æ—Ç–æ –º–æ—Ä–µ –¥–æ –°–µ–≤–µ—Ä–Ω–∞ –ö–∞–ª–∏—Ñ–æ—Ä–Ω–∏—è.",
		pacific_sanddab_description = "–¢–∏—Ö–æ–æ–∫–µ–∞–Ω—Å–∫–∏—è—Ç –º–∞—Ö–º—É—Ä–ª—É–∫ –µ –≤–∏–¥ —Ä–∏–±–∞ —Å –ø–ª–æ—Å–∫–æ —Ç—è–ª–æ. –¢–æ–π –µ –Ω–∞–π-–æ–±—â–∏—è—Ç –≤–∏–¥ –º–∞—Ö–º—É—Ä–ª—É–∫ –∏ —Å–ø–æ–¥–µ–ª—è –º–µ—Å—Ç–æ–æ–±–∏—Ç–∞–Ω–∏–µ —Å –¥—ä–ª–≥–æ—Ä–∏–±–∏—è –º–∞—Ö–º—É—Ä–ª—É–∫ –∏ –ø–æ–∫—ä—Ç–¥–µ–ª–µ–Ω–∏—è –º–∞—Ö–º—É—Ä–ª—É–∫. –¢–æ–π –µ —Å—Ä–µ–¥–Ω–æ–≥–æ–ª—è–º–∞ —Ä–∏–±–∞ —Å —Å–≤–µ—Ç–ª–æ –∫–∞—Ñ—è–≤ —Ü–≤—è—Ç, –ø—Ä–æ—à–∞—Ä–µ–Ω —Å —Ç—ä–º–Ω–æ –∫–∞—Ñ—è–≤–æ –∏–ª–∏ —á–µ—Ä–Ω–æ, –ø–æ–Ω—è–∫–æ–≥–∞ —Å –±–µ–ª–∏ –∏–ª–∏ –æ—Ä–∞–Ω–∂–µ–≤–∏ –ø–µ—Ç–Ω–∞.",
